import React from 'react';
// import ReactDOM from 'react-dom';
import Layout from '../components/MyLayout';
import LikeButton from '../components/LikeButton';
// import Dropdown from '../components/MyDropdown';
import Dropdown from 'react-bootstrap/Dropdown';

export default function Classification() {
    return (
        <Layout>
            <p>Document Classifications by Customers</p>
                <div class="row">
                    <div class="col-md-1" id="customer-names">
                        <Dropdown>
                            <Dropdown.Toggle variant="success" id="customer-names-dropdown">
                                Customer Names
                            </Dropdown.Toggle>

                            <Dropdown.Menu>
                                <Dropdown.Item href="#/action-1">First Customer</Dropdown.Item>
                                <Dropdown.Item href="#/action-2">Second Customer</Dropdown.Item>
                                <Dropdown.Divider />
                                <Dropdown.Item href="#/action-3">Clear Customers</Dropdown.Item>
                            </Dropdown.Menu>
                        </Dropdown>
                    </div>
                    <div class="col-md-1" id="documents_dropdown_container">
 
                    </div>
                </div>
            <p><LikeButton></LikeButton></p>
        </Layout>
    )
};
